(429, '205', 'Something Went Wrong! Contact Support!', 'Something Went Wrong! Contact Support!'),
(430, '206', 'Verification code is wrong..', 'Verification code is wrong..'),
(431, '207', 'Account verified successfully. You can login now..', 'Account verified successfully. You can login now..'),
(432, '208', 'New Password updated successfully!', 'New Password updated successfully!'),
(433, '209', 'Current password is wrong!', 'Current password is wrong!'),
(434, '210', 'New password & Retype password field can\'t matched!', 'New password &amp; Retype password field can\'t matched!'),
(435, '211', 'Sorry, your file is too large.', 'Sorry, your file is too large.'),
(436, '212', 'Sorry, only JPG, JPEG, PNG &amp; GIF files are allowed.', 'Sorry, only JPG, JPEG, PNG &amp; GIF files are allowed.'),
(437, '213', 'Sorry, there was an error uploading your file.', 'Sorry, there was an error uploading your file.'),
(438, '214', 'File is not an image.', 'File is not an image.'),
(439, '215', 'Profile details was successfully updated!', 'Profile details was successfully updated!'),
